export function Initialize() {
	let packet=[];
	packet[0x00] = 0x00;
	packet[0x01] = 0x09;
	device.write(packet, 65);

	if(DpiControl) {
		setDpi(dpi1);
	}
}

export function Render() {
	SendColorPacket();

	if(savedDpi1 != dpi1 && DpiControl) {
		setDpi(dpi1);
	}
}

export function Shutdown() {
	SendColorPacket(true);
}

function SendColorPacket(shutdown = false) {
	let packet = [];
	packet[0x00] = 0x00;
	packet[0x01] = 0x21;
	packet[0x02] = 0xff;
	packet[0x03] = 0x03;

	for(let iIdx = 0; iIdx < 10; iIdx++) {
		let iPxX = vLedPositions[iIdx][0];
		let iPxY = vLedPositions[iIdx][1];
		var color;

		if(shutdown) {
			color = hexToRgb(shutdownColor);
		} else if (LightingMode === "Forced") {
			color = hexToRgb(forcedColor);
		} else {
			color = device.color(iPxX, iPxY);
		}

		let iLedIdx = 4 + iIdx * 3;
		packet[iLedIdx] = color[0];
		packet[iLedIdx+1] = color[1];
		packet[iLedIdx+2] = color[2];
	}

	device.write(packet, 65);
}

function setDpi(dpi) {
	savedDpi1 = dpi1;

	let packet = [];
	packet[0x00] = 0x00;
	packet[0x01] = 0x2d;
	packet[0x02] = 0x05;
	packet[0x03] = 0x02;
	packet[0x04] = 0x11;
	packet[0x05] = 0x17;
	packet[0x06] = (dpi/100);
	device.write(packet, 64);
}

function hexToRgb(hex) {
	let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	let colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);

	return colors;
}

